import React from "react";
import { Carousel } from "react-bootstrap";
import ach1 from "../img/achievement1.jpg";
import ach2 from "../img/achievement2.jpg";


const CarouselContainer = () => {
    return (
        <Carousel>
            <Carousel.Item>
                <img
                    className="d-block w-100"
                    src={ach1}
                    alt=""
                />
            </Carousel.Item>
            <Carousel.Item>
                <img
                    className="d-block w-100"
                    src={ach2}
                    alt=""
                />
            </Carousel.Item>

        </Carousel>
    );
};
export default CarouselContainer;
